import styled from 'styled-components'




const Caption = (props) => {
    return (
        <CAptionTExt>
             <h3><strong>{props.nom}</strong></h3>
             <p> {props.caption} what a wonderful nature</p>
             
        </CAptionTExt>
    );
};

const CaptionText =styled.div`
    margin-left: 10px;
    width: 60px;
    height: 70px;

`
export default Caption;
